import React, { useEffect, useState } from 'react';
import { View, Text, StyleSheet, FlatList, Image, TouchableOpacity, Animated } from 'react-native';
import MapView, { Marker, Callout } from 'react-native-maps';
import * as Location from 'expo-location';
import { Ionicons } from 'react-native-vector-icons';
import { useNavigation } from '@react-navigation/native';

const DicasLocaisScreen = () => {
  const [location, setLocation] = useState(null);
  const [errorMsg, setErrorMsg] = useState(null);
  const [selectedPlace, setSelectedPlace] = useState(null);
  const [expanded, setExpanded] = useState(false);
  const [animationValue] = useState(new Animated.Value(0));

  const navigation = useNavigation(); // Hook para navegação

  useEffect(() => {
    const getLocation = async () => {
      let { status } = await Location.requestForegroundPermissionsAsync();
      if (status !== 'granted') {
        setErrorMsg('Permissão de localização negada!');
        return;
      }

      let location = await Location.getCurrentPositionAsync({});
      setLocation(location.coords);
    };

    getLocation();
  }, []);

  const places = [
    {
      id: '1',
      name: 'Encontro dos Rios',
      address: 'Av. Alvorada, Teresina, PI',
      latitude: -5.035027,  
      longitude: -42.839167, 
      image: 'https://dynamic-media-cdn.tripadvisor.com/media/photo-o/12/0b/ac/28/20180213-194231-largejpg.jpg?w=900&h=500&s=1',
    },
    {
      id: '2',
      name: 'Catedral de Teresina',
      address: 'Praça Dom Severino, Teresina, PI',
      latitude: -5.0913,
      longitude: -42.8044,
      image: 'https://dynamic-media-cdn.tripadvisor.com/media/photo-o/09/b9/63/43/igreja-catedral-de-nossa.jpg?w=800&h=500&s=1',
    },
    {
      id: '3',
      name: 'Mercado Central de Teresina',
      address: 'Rua Rio Branco, Teresina, PI',
      latitude: -5.0893,
      longitude: -42.8029,
      image: 'https://d1lmhdch9ok5y9.cloudfront.net/JBNZ8hzop86Ts1iYtvI_IsLdr74=/370x220/https%3A//d1q5r6jf4yxfe1.cloudfront.net/public/Imagem/2022/10/06/Mercados.jpg',
    },
    {
      id: '4',
      name: 'Museu do Piaui',
      address: 'Praça Marechal Deodoro, Teresina, PI',
      latitude: -5.0896,
      longitude: -42.8015,
      image: 'data:image/jpeg;base64,',  // Imagem vazia
    },
  ];

  const toggleDetails = () => {
    setExpanded(!expanded);
    Animated.timing(animationValue, {
      toValue: expanded ? 0 : 1,
      duration: 300,
      useNativeDriver: false,
    }).start();
  };

  if (errorMsg) {
    return (
      <View style={styles.container}>
        <Text>{errorMsg}</Text>
      </View>
    );
  }

  if (!location) {
    return (
      <View style={styles.container}>
        <Text>Carregando localização...</Text>
      </View>
    );
  }

  return (
    <View style={styles.container}>
      {/* Ícone de voltar para a tela home */}
      <TouchableOpacity
        style={styles.backButton}
        onPress={() => navigation.goBack()}  // Função para voltar
      >
        <Ionicons name="arrow-back" size={30} color="#000" />
      </TouchableOpacity>

      <MapView
        style={styles.map}
        initialRegion={{
          latitude: places[0].latitude,
          longitude: places[0].longitude,
          latitudeDelta: 0.0922,
          longitudeDelta: 0.0421,
        }}
        showsUserLocation={true}
        showsMyLocationButton={true}
      >
        {places.map((place) => (
          <Marker key={place.id} coordinate={{ latitude: place.latitude, longitude: place.longitude }}>
            <Callout onPress={() => setSelectedPlace(place)}>
              <View style={styles.callout}>
                {/* Exibindo imagem apenas se a URL for válida */}
                <Image 
                  source={{ uri: place.image || 'https://via.placeholder.com/130' }} // Imagem fallback
                  style={styles.calloutImage} 
                />
                <Text style={styles.calloutTitle}>{place.name}</Text>
                <Text style={styles.calloutAddress}>{place.address}</Text>
              </View>
            </Callout>
          </Marker>
        ))}
      </MapView>

      <View style={styles.listContainer}>
        <FlatList
          data={places}
          renderItem={({ item }) => (
            <TouchableOpacity style={styles.card} onPress={() => setSelectedPlace(item)}>
              {/* Exibindo imagem apenas se a URL for válida */}
              <Image 
                source={{ uri: item.image || 'https://via.placeholder.com/120' }} // Imagem fallback
                style={styles.cardImage} 
              />
              <View style={styles.cardContent}>
                <Text style={styles.cardTitle}>{item.name}</Text>
                <Text style={styles.cardAddress}>{item.address}</Text>
              </View>
            </TouchableOpacity>
          )}
          keyExtractor={(item) => item.id}
        />
      </View>

      {selectedPlace && (
        <Animated.View
          style={[
            styles.detailsContainer,
            {
              height: animationValue.interpolate({
                inputRange: [0, 1],
                outputRange: ['0%', '60%'],
              }),
            },
          ]}
        >
          <TouchableOpacity onPress={toggleDetails} style={styles.closeButton}>
            <Text style={styles.closeButtonText}>×</Text>
          </TouchableOpacity>
          <Text style={styles.detailsTitle}>{selectedPlace.name}</Text>
          <Text style={styles.detailsAddress}>{selectedPlace.address}</Text>
          {/* Exibindo imagem apenas se a URL for válida */}
          <Image 
            source={{ uri: selectedPlace.image || 'https://via.placeholder.com/200' }} // Imagem fallback
            style={styles.detailsImage} 
          />
        </Animated.View>
      )}
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#f5f5f5',
  },
  backButton: {
    position: 'absolute',
    top: 40,
    left: 10,
    backgroundColor: '#ffffff',
    borderRadius: 30,
    padding: 10,
    elevation: 5,
  },
  map: {
    width: '100%',
    height: '50%',
    borderBottomLeftRadius: 20,
    borderBottomRightRadius: 20,
  },
  listContainer: {
    flex: 1,
    marginTop: 10,
    paddingHorizontal: 10,
  },
  card: {
    flexDirection: 'row',
    backgroundColor: '#ffffff',
    marginBottom: 12,
    borderRadius: 15,
    overflow: 'hidden',
    elevation: 5,
    shadowColor: '#000',
    shadowOffset: { width: 0, height: 4 },
    shadowOpacity: 0.1,
    shadowRadius: 10,
  },
  cardImage: {
    width: 120,
    height: 120,
    borderRadius: 15,
  },
  cardContent: {
    flex: 1,
    padding: 15,
  },
  cardTitle: {
    fontSize: 18,
    fontWeight: '600',
    color: '#333',
  },
  cardAddress: {
    fontSize: 14,
    color: '#666',
    marginTop: 5,
  },
  callout: {
    alignItems: 'center',
    width: 150,
  },
  calloutImage: {
    width: 130,
    height: 130,
    borderRadius: 15,
    marginBottom: 5,
  },
  calloutTitle: {
    fontWeight: 'bold',
    fontSize: 15,
    textAlign: 'center',
    color: '#333',
  },
  calloutAddress: {
    fontSize: 12,
    textAlign: 'center',
    color: '#666',
  },
  detailsContainer: {
    position: 'absolute',
    bottom: 0,
    left: 0,
    right: 0,
    backgroundColor: '#ffffff',
    borderTopLeftRadius: 20,
    borderTopRightRadius: 20,
    padding: 20,
    elevation: 10,
  },
  closeButton: {
    position: 'absolute',
    top: 10,
    right: 10,
    backgroundColor: '#ffffff',
    borderRadius: 20,
    width: 30,
    height: 30,
    justifyContent: 'center',
    alignItems: 'center',
    elevation: 7,
  },
  closeButtonText: {
    fontSize: 20,
    color: '#333',
    fontWeight: 'bold',
  },
  detailsTitle: {
    fontSize: 22,
    fontWeight: 'bold',
    color: '#333',
  },
  detailsAddress: {
    fontSize: 16,
    color: '#666',
    marginTop: 10,
  },
  detailsImage: {
    width: '100%',
    height: 200,
    borderRadius: 15,
    marginTop: 20,
  },
});

export default DicasLocaisScreen;
